import React from "react";
import styled from "styled-components";
import NewItems from "../../components/product/NewItems";

const StyleNews = styled.div`
  margin-top: 5rem;
  .new-main {
    display: flex;
  }
  .new-left {
    width: 60%;
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-gap: 24px 12px;
    border-radius: 5px;
    background-color: #fff;
    padding: 12px;
    box-shadow: 0 1px 3px -1px rgb(200 200 200 / 10%),
      0 1px 4px 1px rgb(200 200 200 / 5%), 0 1px 6px 2px rgb(200 200 200 / 5%);
  }

  .new-right {
    width: 40%;
    background-color: #00aefd;
  }
`;

const News = () => {
  return (
    <StyleNews>
      <div className="container">
        <div className="new-main">
          <div className="new-left">
            <div className="new-left__list">
              <NewItems></NewItems>
              <NewItems></NewItems>
              <NewItems></NewItems>
              <NewItems></NewItems>
              <NewItems></NewItems>
              <NewItems></NewItems>
              <NewItems></NewItems>
              <NewItems></NewItems>
            </div>
          </div>
          <div className="new-right"></div>
        </div>
      </div>
    </StyleNews>
  );
};

export default News;
